import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { MyProvider } from './MyContext'

ReactDOM.render(
  <MyProvider>
     <App />
  </MyProvider>,
document.getElementById('root')
);

